import { useState, useEffect } from 'react';
import './App.css';

function App() {
  const [catFact, setCatFact] = useState('')
  useEffect(()=>{
    fetch("https://catfact.ninja/fact")
    .then((res) => res.json())
    .then((data)=>{
      setCatFact(data.fact)
    })
  },[])

  return (
    <div className="App">
      <button>Cat fact</button>
      {catFact}
    </div>
  );
}


export default App;
